import React, { useState } from 'react'
import '../../Style/PostImg.css'
import AddPhotoAlternateIcon from '@material-ui/icons/AddPhotoAlternate';

function PostImg() {
    const[status, setStatus] = useState(false)
    function handelClick(){
        setStatus(!status)
    }
    return (
        <>
        {status?
        (
            <div className='postimg-box' className='postimg-box' onClick={setStatus}>
                <img className='postimg-img' src='https://dotobjyajpegd.cloudfront.net/photo/5d3a66f962710e25dc99ffa3_m'/>
            </div>
        ):(
            <div className='postimg-box' onClick={setStatus}>
                <AddPhotoAlternateIcon style={{fontSize: 200}}/>
            </div>
        )}
        </>
    )
}

export default PostImg
